import React from "react";

const mainnav = {
  display: " flex",
  listStyleType: "none",
  gap: "15px",
};

const Navbar = (props) => {
  return (
    <div className="main-nav">
      <ul>
        <li>{props.first}</li>
        <li>{props.second}</li>
        <li>{props.third}</li>
        <li>{props.fourth}</li>
      </ul>
    </div>
  );
};

export default Navbar;
